import Logo from "../assets/logo.js";
import Search from "../assets/icons/ui/search.js";
import Human from "../assets/icons/ui/human.js";
/*
import HeaderMobile from '../layouts/header/header_mobile.js';
import NavMobile from '../layouts/header/nav_mobile.js';*/

const Header = () => (
  <div>
  <div id="header">
    <div id="desktop-nav">
                <div class="nav-container">
    <a class="logo-link" href="/"><Logo /></a>
    <div class="nav-inner nav-inner-desktop">
            <div class="nav-controls">
        <div class="search-wrapper">
          <span class="search-icon"><span class="search-icon-inner"><Search /></span></span>
      <input class="search" type="search" name="q" placeholder="料理、材料、キャンプ道具..."/>
    </div>
      <a href="/blog" class="hover-accent articles">記事一覧</a>
    </div>
    <div class="nav-controls">
      <a href="/signin" class="hover-accent">ログイン</a>
      <a class="button icon-button button-black nav-account-button" href="/signup"><Human />アカウントを作成</a>
    </div>
  </div>
  </div>
</div>
<div id="mobile-nav">
{/*<HeaderMobile />*/}
</div>
</div>
<div id="app-nav">
{/*<NavMobile />*/}
</div>

<style jsx>{`
.nav-account-button {
margin:0;
}
`}</style>
</div>
)

export default Header
